import React from 'react';
import {Link} from '@reach/router';
import PirateForm from '../components/PirateForm';

export default function CreatePirate(){
    const createPirate={
        name:"",
        imageUrl:"",
        treasures:"",
        phrase:"",
        position:"",
        pegLeg:true,
        eyePatch:true,
        hookHand:true
    };
    return (
        <div>
            <h1>Add a Pirate</h1>
            <Link to="/">Crew Board</Link>
            <PirateForm
                pirate={createPirate}
                method="post"
                url="http://localhost:8000/api/pirates"
            />
        </div>
    )
}
